/* Be Unique patId:1041*//* starting time: 2016-6-9 19:14 */#include<iostream>#include<set>#include<vector>#include<map>#include<algorithm>#define MAX 100000using namespace std;int main(){	int n;	int winner;	int temp;	int a[MAX];	map<int,int> mark;	vector<int> vec;	vector<int> vec1;	cin>>n;	for(int i=0;i<n;i++){		cin>>temp;		vec.push_back(temp);        mark.insert(make_pair(temp,i));	}	sort(vec.begin(),vec.end());	vector<int>::iterator iter1 = vec.begin();	vector<int>::iterator tempIter;;	for(;iter1!=vec.end();){       if(*(iter1)!=*(iter1+1)) {		   vec1.push_back(*iter1);		   iter1++;	   }	   else{		   int i=1;		   while((iter1+i)!=vec.end()&&*(iter1)==*(iter1+i)){			 i++;    		   }		   iter1+=i;	   }	}	if(vec1.empty()){		cout<<"None"<<endl;		return 0;	}	vector<int>::iterator iter = vec1.begin();	int min=mark[*iter];	int minIndex=*iter;	for(;iter!=vec1.end();iter++){		 if(min>mark[*iter]){			min=mark[*iter];            minIndex=*iter;				 } 	}	cout<<minIndex<<endl;	return 0;}